import React from 'react';

// Card component to display an image with a title
const Card = ({ title }) => {
  // Build the image URL from the title (assuming images are in public folder)
  const imageUrl = process.env.PUBLIC_URL + `/images/${title}.jpg`;

  return (
    <div className="card">
      <img src={imageUrl} alt={title} className="card-image" />
      <div className="card-title">{title}</div>
    </div>
  );
};

export default Card;
